import React from 'react'
import { useTheme } from '@material-ui/core/styles';
import { CarasouleImageStyles } from '../styles/muiStyles';
import Carousel from 'better-react-carousel'

export default function CarasoleImage() {
    const classes = CarasouleImageStyles();
    return (

        <Carousel cols={1} rows={1} gap={10} loop>
            <div >
                <Carousel.Item >
                    <img className={classes.img} width="100%" src="https://th.bing.com/th/id/R.5e0a799f3d534f239d16956ace6b8a8f?rik=pdjVukHCfTKuOw&riu=http%3a%2f%2fcdn.thinglink.me%2fapi%2fimage%2f479353026285404161%2f1024%2f10%2fscaletowidth%2f0%2f0%2f1%2f1%2ffalse%2ftrue%3fwait%3dtrue&ehk=l0qlnh5dfbnyUpikpXKyqk3oSNv0Ub9B%2bqlTlmUbKsw%3d&risl=&pid=ImgRaw&r=0" />
                </Carousel.Item>
            </div>
            <div >
                <Carousel.Item className={classes.image}>
                    <img className={classes.img} width="100%" src="https://picsum.photos/800/600?random=2" />
                </Carousel.Item >
            </div>


        </Carousel>

    );
}
